import React from "react";
import { Link } from "react-router-dom";

class Header extends React.Component {
	rende() {
		return (
			<nav>
				<li><Link to="/">Home</Link></li>
				<li><Link to="login">Login</Link></li>
				<li><Link to="main">Main</Link></li>
			</nav>
		)
	}
}
export default Header
